(clojure.core/defn initiate-multipart-upload "This operation initiates a multipart upload. Amazon Glacier creates a multipart\nupload resource and returns its ID in the response. The multipart upload ID is\nused in subsequent requests to upload parts of an archive (see\nUploadMultipartPart).\n When you initiate a multipart upload, you specify the part size in number of\nbytes. The part size must be a megabyte (1024 KB) multiplied by a power of 2-for\nexample, 1048576 (1 MB), 2097152 (2 MB), 4194304 (4 MB), 8388608 (8 MB), and so\non. The minimum allowable part size is 1 MB, and the maximum is 4 GB.\n Every part you upload to this resource (see UploadMultipartPart), except the\nlast one, must have the same size. The last one can be the same size or smaller.\nFor example, suppose you want to upload a 16.2 MB file. If you initiate the\nmultipart upload with a part size of 4 MB, you will upload four parts of 4 MB\neach and one part of 0.2 MB.\n You don't need to know the size of the archive when you start a multipart\nupload because Amazon Glacier does not require you to specify the overall\narchive size.\n After you complete the multipart upload, Amazon Glacier removes the multipart\nupload resource referenced by the ID. Amazon Glacier also removes the multipart\nupload resource if you cancel the multipart upload or it may be removed if there\nis no activity for a period of 24 hours.\n An AWS account has full permission to perform all operations (actions).\nHowever, AWS Identity and Access Management (IAM) users don't have any\npermissions by default. You must grant them explicit permission to perform\nspecific actions. For more information, see Access Control Using AWS Identity\nand Access Management (IAM)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/using-iam-with-amazon-glacier.html).\n For conceptual information and underlying REST API, see Uploading Large\nArchives in Parts (Multipart Upload)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/uploading-archive-mpu.html)\nand Initiate Multipart Upload\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-multipart-initiate-upload.html)\nin the Amazon Glacier Developer Guide." ([initiate-multipart-upload-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "POST" "/{accountId}/vaults/{vaultName}/multipart-uploads" initiate-multipart-upload-input :portkey.aws.glacier.-2012-06-01/initiate-multipart-upload-input {:payload nil, :move {}, :headers {"archiveDescription" ["x-amz-archive-description" nil], "partSize" ["x-amz-part-size" nil]}, :uri {"accountId" "accountId", "vaultName" "vaultName"}, :querystring {}} 201 :portkey.aws.glacier.-2012-06-01/initiate-multipart-upload-output {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
