(clojure.core/defn set-vault-notifications "This operation configures notifications that will be sent when specific events\nhappen to a vault. By default, you don't get any notifications.\n To configure vault notifications, send a PUT request to the\nnotification-configuration subresource of the vault. The request should include\na JSON document that provides an Amazon SNS topic and specific events for which\nyou want Amazon Glacier to send notifications to the topic.\n Amazon SNS topics must grant permission to the vault to be allowed to publish\nnotifications to the topic. You can configure a vault to publish a notification\nfor the following vault events:\n * ArchiveRetrievalCompleted This event occurs when a job that was initiated for\nan archive retrieval is completed (InitiateJob). The status of the completed job\ncan be \"Succeeded\" or \"Failed\". The notification sent to the SNS topic is the\nsame output as returned from DescribeJob.\n * InventoryRetrievalCompleted This event occurs when a job that was initiated\nfor an inventory retrieval is completed (InitiateJob). The status of the\ncompleted job can be \"Succeeded\" or \"Failed\". The notification sent to the SNS\ntopic is the same output as returned from DescribeJob.\n An AWS account has full permission to perform all operations (actions).\nHowever, AWS Identity and Access Management (IAM) users don't have any\npermissions by default. You must grant them explicit permission to perform\nspecific actions. For more information, see Access Control Using AWS Identity\nand Access Management (IAM)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/using-iam-with-amazon-glacier.html).\n For conceptual information and underlying REST API, see Configuring Vault\nNotifications in Amazon Glacier\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/configuring-notifications.html)\nand Set Vault Notification Configuration\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-vault-notifications-put.html)\nin the Amazon Glacier Developer Guide." ([set-vault-notifications-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "PUT" "/{accountId}/vaults/{vaultName}/notification-configuration" set-vault-notifications-input :portkey.aws.glacier.-2012-06-01/set-vault-notifications-input {:payload "vaultNotificationConfig", :move {}, :headers {}, :uri {"accountId" "accountId", "vaultName" "vaultName"}, :querystring {}} 204 nil {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
