(clojure.core/defn describe-job "This operation returns information about a job you previously initiated,\nincluding the job initiation date, the user who initiated the job, the job\nstatus code/message and the Amazon SNS topic to notify after Amazon Glacier\ncompletes the job. For more information about initiating a job, see InitiateJob.\n This operation enables you to check the status of your job. However, it is\nstrongly recommended that you set up an Amazon SNS topic and specify it in your\ninitiate job request so that Amazon Glacier can notify the topic after it\ncompletes the job.\n A job ID will not expire for at least 24 hours after Amazon Glacier completes\nthe job.\n An AWS account has full permission to perform all operations (actions).\nHowever, AWS Identity and Access Management (IAM) users don't have any\npermissions by default. You must grant them explicit permission to perform\nspecific actions. For more information, see Access Control Using AWS Identity\nand Access Management (IAM)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/using-iam-with-amazon-glacier.html).\n For more information about using this operation, see the documentation for the\nunderlying REST API Describe Job\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-describe-job-get.html)\nin the Amazon Glacier Developer Guide." ([describe-job-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "GET" "/{accountId}/vaults/{vaultName}/jobs/{jobId}" describe-job-input :portkey.aws.glacier.-2012-06-01/describe-job-input {:payload nil, :move {}, :headers {}, :uri {"accountId" "accountId", "vaultName" "vaultName", "jobId" "jobId"}, :querystring {}} nil :portkey.aws.glacier.-2012-06-01/glacier-job-description {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
