(clojure.core/defn initiate-vault-lock "This operation initiates the vault locking process by doing the following:\n * Installing a vault lock policy on the specified vault.\n * Setting the lock state of vault lock to InProgress.\n * Returning a lock ID, which is used to complete the vault locking process.\n You can set one vault lock policy for each vault and this policy can be up to\n20 KB in size. For more information about vault lock policies, see Amazon\nGlacier Access Control with Vault Lock Policies\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/vault-lock-policy.html).\n You must complete the vault locking process within 24 hours after the vault\nlock enters the InProgress state. After the 24 hour window ends, the lock ID\nexpires, the vault automatically exits the InProgress state, and the vault lock\npolicy is removed from the vault. You call CompleteVaultLock to complete the\nvault locking process by setting the state of the vault lock to Locked.\n After a vault lock is in the Locked state, you cannot initiate a new vault lock\nfor the vault.\n You can abort the vault locking process by calling AbortVaultLock. You can get\nthe state of the vault lock by calling GetVaultLock. For more information about\nthe vault locking process, Amazon Glacier Vault Lock\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/vault-lock.html).\n If this operation is called when the vault lock is in the InProgress state, the\noperation returns an AccessDeniedException error. When the vault lock is in the\nInProgress state you must call AbortVaultLock before you can initiate a new\nvault lock policy." ([initiate-vault-lock-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "POST" "/{accountId}/vaults/{vaultName}/lock-policy" initiate-vault-lock-input :portkey.aws.glacier.-2012-06-01/initiate-vault-lock-input {:payload "policy", :move {}, :headers {}, :uri {"accountId" "accountId", "vaultName" "vaultName"}, :querystring {}} 201 :portkey.aws.glacier.-2012-06-01/initiate-vault-lock-output {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
(clojure.spec.alpha/fdef initiate-vault-lock :args (clojure.spec.alpha/tuple :portkey.aws.glacier.-2012-06-01/initiate-vault-lock-input) :ret (clojure.spec.alpha/and :portkey.aws.glacier.-2012-06-01/initiate-vault-lock-output))

(clojure.core/defn delete-vault "This operation deletes a vault. Amazon Glacier will delete a vault only if there\nare no archives in the vault as of the last inventory and there have been no\nwrites to the vault since the last inventory. If either of these conditions is\nnot satisfied, the vault deletion fails (that is, the vault is not removed) and\nAmazon Glacier returns an error. You can use DescribeVault to return the number\nof archives in a vault, and you can use Initiate a Job (POST jobs)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-initiate-job-post.html)\nto initiate a new inventory retrieval for a vault. The inventory contains the\narchive IDs you use to delete archives using Delete Archive (DELETE archive)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-archive-delete.html).\n This operation is idempotent.\n An AWS account has full permission to perform all operations (actions).\nHowever, AWS Identity and Access Management (IAM) users don't have any\npermissions by default. You must grant them explicit permission to perform\nspecific actions. For more information, see Access Control Using AWS Identity\nand Access Management (IAM)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/using-iam-with-amazon-glacier.html).\n For conceptual information and underlying REST API, see Deleting a Vault in\nAmazon Glacier\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/deleting-vaults.html) and\nDelete Vault\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-vault-delete.html) in\nthe Amazon Glacier Developer Guide." ([delete-vault-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "DELETE" "/{accountId}/vaults/{vaultName}" delete-vault-input :portkey.aws.glacier.-2012-06-01/delete-vault-input {:payload nil, :move {}, :headers {}, :uri {"accountId" "accountId", "vaultName" "vaultName"}, :querystring {}} 204 nil {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "