(clojure.core/defn abort-vault-lock "This operation aborts the vault locking process if the vault lock is not in the\nLocked state. If the vault lock is in the Locked state when this operation is\nrequested, the operation returns an AccessDeniedException error. Aborting the\nvault locking process removes the vault lock policy from the specified vault.\n A vault lock is put into the InProgress state by calling InitiateVaultLock. A\nvault lock is put into the Locked state by calling CompleteVaultLock. You can\nget the state of a vault lock by calling GetVaultLock. For more information\nabout the vault locking process, see Amazon Glacier Vault Lock\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/vault-lock.html). For more\ninformation about vault lock policies, see Amazon Glacier Access Control with\nVault Lock Policies\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/vault-lock-policy.html).\n This operation is idempotent. You can successfully invoke this operation\nmultiple times, if the vault lock is in the InProgress state or if there is no\npolicy associated with the vault." ([abort-vault-lock-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "DELETE" "/{accountId}/vaults/{vaultName}/lock-policy" abort-vault-lock-input :portkey.aws.glacier.-2012-06-01/abort-vault-lock-input {:payload nil, :move {}, :headers {}, :uri {"accountId" "accountId", "vaultName" "vaultName"}, :querystring {}} 204 nil {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
(clojure.spec.alpha/fdef abort-vault-lock :args (clojure.spec.alpha/tuple :portkey.aws.glacier.-2012-06-01/abort-vault-lock-input) :ret clojure.core/true?)

(clojure.core/defn list-parts "This operation lists the parts of an archive that have been uploaded in a\nspecific multipart upload. You can make this request at any time during an\nin-progress multipart upload before you complete the upload (see\nCompleteMultipartUpload. List Parts returns an error for completed uploads. The\nlist returned in the List Parts response is sorted by part range.\n The List Parts operation supports pagination. By default, this operation\nreturns up to 1,000 uploaded parts in the response. You should always check the\nresponse for a marker at which to continue the list; if there are no more items\nthe marker is null. To return a list of parts that begins at a specific part,\nset the marker request parameter to the value you obtained from a previous List\nParts request. You can also limit the number of parts returned in the response\nby specifying the limit parameter in the request.\n An AWS account has full permission to perform all operations (actions).\nHowever, AWS Identity and Access Management (IAM) users don't have any\npermissions by default. You must grant them explicit permission to perform\nspecific actions. For more information, see Access Control Using AWS Identity\nand Access Management (IAM)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/using-iam-with-amazon-glacier.html).\n For conceptual information and the underlying REST API, see Working with\nArchives in Amazon Glacier\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/working-with-archives.html)\nand List Parts\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-multipart-list-parts.html)\nin the Amazon Glacier Developer Guide." ([list-parts-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "GET" "/{accountId}/vaults/{vaultName}/multipart-uploads/{uploadId}" list-parts-input :portkey.aws.glacier.-2012-06-01/list-parts-input {:payload nil, :move {}, :headers {}, :uri {"accountId" "accountId", "vaultName" "vaultName", "uploadId" "uploadId"}, :querystring {"marker" "marker", "limit" "limit"}} nil :portkey.aws.glacier.-2012-06-01/list-parts-output {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
