(clojure.core/defn set-vault-access-policy "This operation configures an access policy for a vault and will overwrite an\nexisting policy. To configure a vault access policy, send a PUT request to the\naccess-policy subresource of the vault. An access policy is specific to a vault\nand is also called a vault subresource. You can set one access policy per vault\nand the policy can be up to 20 KB in size. For more information about vault\naccess policies, see Amazon Glacier Access Control with Vault Access Policies\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/vault-access-policy.html)." ([set-vault-access-policy-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "PUT" "/{accountId}/vaults/{vaultName}/access-policy" set-vault-access-policy-input :portkey.aws.glacier.-2012-06-01/set-vault-access-policy-input {:payload "policy", :move {}, :headers {}, :uri {"accountId" "accountId", "vaultName" "vaultName"}, :querystring {}} 204 nil {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
