(clojure.core/defn create-vault "This operation creates a new vault with the specified name. The name of the\nvault must be unique within a region for an AWS account. You can create up to\n1,000 vaults per account. If you need to create more vaults, contact Amazon\nGlacier.\n You must use the following guidelines when naming a vault.\n * Names can be between 1 and 255 characters long.\n * Allowed characters are a-z, A-Z, 0-9, '_' (underscore), '-' (hyphen), and '.'\n(period).\n This operation is idempotent.\n An AWS account has full permission to perform all operations (actions).\nHowever, AWS Identity and Access Management (IAM) users don't have any\npermissions by default. You must grant them explicit permission to perform\nspecific actions. For more information, see Access Control Using AWS Identity\nand Access Management (IAM)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/using-iam-with-amazon-glacier.html).\n For conceptual information and underlying REST API, see Creating a Vault in\nAmazon Glacier\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/creating-vaults.html) and\nCreate Vault\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-vault-put.html) in the\nAmazon Glacier Developer Guide." ([create-vault-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "PUT" "/{accountId}/vaults/{vaultName}" create-vault-input :portkey.aws.glacier.-2012-06-01/create-vault-input {:payload nil, :move {}, :headers {}, :uri {"accountId" "accountId", "vaultName" "vaultName"}, :querystring {}} 201 :portkey.aws.glacier.-2012-06-01/create-vault-output {"InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception, "LimitExceededException" :portkey.aws.glacier.-2012-06-01/limit-exceeded-exception})))
