(clojure.core/defn complete-vault-lock "This operation completes the vault locking process by transitioning the vault\nlock from the InProgress state to the Locked state, which causes the vault lock\npolicy to become unchangeable. A vault lock is put into the InProgress state by\ncalling InitiateVaultLock. You can obtain the state of the vault lock by calling\nGetVaultLock. For more information about the vault locking process, Amazon\nGlacier Vault Lock\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/vault-lock.html).\n This operation is idempotent. This request is always successful if the vault\nlock is in the Locked state and the provided lock ID matches the lock ID\noriginally used to lock the vault.\n If an invalid lock ID is passed in the request when the vault lock is in the\nLocked state, the operation returns an AccessDeniedException error. If an\ninvalid lock ID is passed in the request when the vault lock is in the\nInProgress state, the operation throws an InvalidParameter error." ([complete-vault-lock-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "POST" "/{accountId}/vaults/{vaultName}/lock-policy/{lockId}" complete-vault-lock-input :portkey.aws.glacier.-2012-06-01/complete-vault-lock-input {:payload nil, :move {}, :headers {}, :uri {"accountId" "accountId", "vaultName" "vaultName", "lockId" "lockId"}, :querystring {}} 204 nil {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
