(clojure.core/defn upload-multipart-part "This operation uploads a part of an archive. You can upload archive parts in any\norder. You can also upload them in parallel. You can upload up to 10,000 parts\nfor a multipart upload.\n Amazon Glacier rejects your upload part request if any of the following\nconditions is true:\n * SHA256 tree hash does not matchTo ensure that part data is not corrupted in\ntransmission, you compute a SHA256 tree hash of the part and include it in your\nrequest. Upon receiving the part data, Amazon Glacier also computes a SHA256\ntree hash. If these hash values don't match, the operation fails. For\ninformation about computing a SHA256 tree hash, see Computing Checksums\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/checksum-calculations.html).\n * Part size does not matchThe size of each part except the last must match the\nsize specified in the corresponding InitiateMultipartUpload request. The size of\nthe last part must be the same size as, or smaller than, the specified size.\n If you upload a part whose size is smaller than the part size you specified in\nyour initiate multipart upload request and that part is not the last part, then\nthe upload part request will succeed. However, the subsequent Complete Multipart\nUpload request will fail.\n * Range does not alignThe byte range value in the request does not align with\nthe part size specified in the corresponding initiate request. For example, if\nyou specify a part size of 4194304 bytes (4 MB), then 0 to 4194303 bytes (4 MB -\n1) and 4194304 (4 MB) to 8388607 (8 MB - 1) are valid part ranges. However, if\nyou set a range value of 2 MB to 6 MB, the range does not align with the part\nsize and the upload will fail.\n This operation is idempotent. If you upload the same part multiple times, the\ndata included in the most recent request overwrites the previously uploaded\ndata.\n An AWS account has full permission to perform all operations (actions).\nHowever, AWS Identity and Access Management (IAM) users don't have any\npermissions by default. You must grant them explicit permission to perform\nspecific actions. For more information, see Access Control Using AWS Identity\nand Access Management (IAM)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/using-iam-with-amazon-glacier.html).\n For conceptual information and underlying REST API, see Uploading Large\nArchives in Parts (Multipart Upload)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/uploading-archive-mpu.html)\nand Upload Part\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-upload-part.html) in\nthe Amazon Glacier Developer Guide." ([upload-multipart-part-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "PUT" "/{accountId}/vaults/{vaultName}/multipart-uploads/{uploadId}" upload-multipart-part-input :portkey.aws.glacier.-2012-06-01/upload-multipart-part-input {:payload "body", :move {}, :headers {"checksum" ["x-amz-sha256-tree-hash" nil], "range" ["Content-Range" nil]}, :uri {"accountId" "accountId", "vaultName" "vaultName", "uploadId" "uploadId"}, :querystring {}} 204 :portkey.aws.glacier.-2012-06-01/upload-multipart-part-output {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "RequestTimeoutException" :portkey.aws.glacier.-2012-06-01/request-timeout-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
