(clojure.core/defn upload-archive "This operation adds an archive to a vault. This is a synchronous operation, and\nfor a successful upload, your data is durably persisted. Amazon Glacier returns\nthe archive ID in the x-amz-archive-id header of the response.\n You must use the archive ID to access your data in Amazon Glacier. After you\nupload an archive, you should save the archive ID returned so that you can\nretrieve or delete the archive later. Besides saving the archive ID, you can\nalso index it and give it a friendly name to allow for better searching. You can\nalso use the optional archive description field to specify how the archive is\nreferred to in an external index of archives, such as you might create in Amazon\nDynamoDB. You can also get the vault inventory to obtain a list of archive IDs\nin a vault. For more information, see InitiateJob.\n You must provide a SHA256 tree hash of the data you are uploading. For\ninformation about computing a SHA256 tree hash, see Computing Checksums\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/checksum-calculations.html).\n You can optionally specify an archive description of up to 1,024 printable\nASCII characters. You can get the archive description when you either retrieve\nthe archive or get the vault inventory. For more information, see InitiateJob.\nAmazon Glacier does not interpret the description in any way. An archive\ndescription does not need to be unique. You cannot use the description to\nretrieve or sort the archive list.\n Archives are immutable. After you upload an archive, you cannot edit the\narchive or its description.\n An AWS account has full permission to perform all operations (actions).\nHowever, AWS Identity and Access Management (IAM) users don't have any\npermissions by default. You must grant them explicit permission to perform\nspecific actions. For more information, see Access Control Using AWS Identity\nand Access Management (IAM)\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/using-iam-with-amazon-glacier.html).\n For conceptual information and underlying REST API, see Uploading an Archive in\nAmazon Glacier\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/uploading-an-archive.html)\nand Upload Archive\n(http://docs.aws.amazon.com/amazonglacier/latest/dev/api-archive-post.html) in\nthe Amazon Glacier Developer Guide." ([upload-archive-input] (portkey.aws/-rest-json-call portkey.aws.glacier.-2012-06-01/endpoints "POST" "/{accountId}/vaults/{vaultName}/archives" upload-archive-input :portkey.aws.glacier.-2012-06-01/upload-archive-input {:payload "body", :move {}, :headers {"archiveDescription" ["x-amz-archive-description" nil], "checksum" ["x-amz-sha256-tree-hash" nil]}, :uri {"vaultName" "vaultName", "accountId" "accountId"}, :querystring {}} 201 :portkey.aws.glacier.-2012-06-01/archive-creation-output {"ResourceNotFoundException" :portkey.aws.glacier.-2012-06-01/resource-not-found-exception, "InvalidParameterValueException" :portkey.aws.glacier.-2012-06-01/invalid-parameter-value-exception, "MissingParameterValueException" :portkey.aws.glacier.-2012-06-01/missing-parameter-value-exception, "RequestTimeoutException" :portkey.aws.glacier.-2012-06-01/request-timeout-exception, "ServiceUnavailableException" :portkey.aws.glacier.-2012-06-01/service-unavailable-exception})))
